Avatar: The Last Airbender (Avatar: The Legend of Aang in some regions) is an American television series that aired for three seasons on Nickelodeon from 2005 to 2008. Avatar: The Last Airbender is set in an Asian-influenced world[1] wherein some are able to manipulate the classical elements by use of psychokinetic variants of Chinese martial arts known as &quot;bending&quot;. The show combined the styles of anime and American cartoons, and relied on the imagery of various East Asian, Inuit, Southeast Asian, South Asian and New World societies. Due to this style, the series regularly enters the conversation regarding its consideration as an anime work.

Complete Season 1-3 with Extras and Soundtracks

